import Profile from "./components/home/Profile";
import './App.css';
import Navbar from "./components/navbar/Navbar";
import Header from "./components/header/Header";

function App() {
  return (
    <div className="bg-move"
      style={{
        backgroundImage: `url("assets/images/n2.jpg")`,
      }}
    >
      <Navbar />
      <div className="">
        <Profile />
        <Header />
      </div>

    </div>
  );
}

export default App;
